  outl[76] += incr1[76]*rdv2l-1.0*incr2[76]*rdvSq4l; 
  outl[77] += incr1[77]*rdv2l-1.0*incr2[77]*rdvSq4l; 
  outl[78] += incr1[78]*rdv2l-1.0*incr2[78]*rdvSq4l; 
  outl[79] += incr1[79]*rdv2l-1.0*incr2[79]*rdvSq4l; 

  const double vMuMid = (0.7905694150420947*nuUz[2])/nu-(0.7071067811865475*nuUz[0])/nu+wl[3]; 
  return std::abs(vMuMid); 
